import "./App.css";
import CardList from "./Components/Pages/CardList";
import Home from "./Components/Pages/Home";

const App = () => {
  return (
    <div className="App">
      <header className="App-header">
        <Home />
        <CardList />
      </header>
    </div>
  );
};

export default App;
